B.Z4=new A.aa(B.bB,["Choose Seasonal Produce for Better Flavor and Value","Buying fruits and vegetables in season ensures peak freshness and taste while often being more affordable.","images/seasonal.jpg","Seasonal produce is harvested at its peak ripeness, leading to better flavor and nutrition. Check local seasonal guides to know what\u2019s available.","Buying in season often means lower prices due to higher availability, saving you money while supporting local farmers.","Try new recipes with seasonal ingredients to keep your meals fresh and exciting while reducing your carbon footprint."],t.m)
B.Z1=new A.aa(B.bB,["Inspect Produce for Quality Before Buying","Take time to examine fruits and vegetables to ensure you\u2019re selecting the best quality items.","images/inspect.jpg","Look for vibrant colors and firm textures. Avoid produce with bruises, soft spots, or discoloration as they may be overripe or spoiled.","For leafy greens, check for crisp leaves and avoid any that appear wilted or yellowing. Freshness is key to both taste and nutritional value.","Smell the produce! A fresh scent usually indicates good quality, especially for fruits like melons and berries."],t.m)
B.Z0=new A.aa(B.bB,["Support Local Farmers and Markets","Buying directly from local farmers and markets benefits the community and often provides fresher options.","images/support.jpg","Local farmers\u2019 markets typically offer fresher produce since it\u2019s harvested closer to the time of sale, often resulting in better flavor.","By supporting local farmers, you contribute to your community\u2019s economy and help promote sustainable farming practices.","Many farmers are happy to share their growing practices, giving you insights into how your food is produced and fostering transparency."],t.m)
B.Z6=new A.aa(B.bB,["Prioritize Organic and Sustainable Products","Choosing organic and sustainably grown produce can enhance your health and protect the environment.","images/sustainable.jpg","Organic farming practices avoid synthetic pesticides and fertilizers, reducing your exposure to harmful chemicals.","Sustainable farming methods focus on preserving natural resources and biodiversity, making it better for the planet and future generations.","Look for certification labels when shopping to ensure the produce meets organic or sustainable standards."],t.m)
B.Z2=new A.aa(B.bB,["Know Your Produce Storage and Handling","Proper storage and handling of fruits and vegetables extend their shelf life and maintain quality.","images/storage.png","Store fruits and vegetables in the right conditions; for instance, keep apples in a cool place away from other produce to prevent spoilage.","Wash produce just before consumption to avoid moisture build-up, which can lead to mold and spoilage.","Use airtight containers or resealable bags for cut fruits and vegetables to keep them fresh longer in the fridge."],t.m)
B.Z3=new A.aa(B.bB,["Plan Your Purchases to Minimize Waste","Planning your meals and shopping list helps reduce waste and ensures you buy only what you need.","images/waste.jpg","Create a weekly meal plan and shopping list to ensure you buy only the items you will use, helping you save money and reduce waste.","Consider using leftovers creatively in new meals to make the most of your produce and avoid throwing away unused food.","Freeze excess produce that you can\u2019t use right away, such as berries or herbs, to prevent spoilage and extend their usability."],t.m)
